import React, { useContext, useMemo } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import LinearProgress from '@mui/material/LinearProgress';
import Navbar from '../components/Navbar';
import workshops from '../data/workshops';
import { UserContext } from '../contexts/UserContext';

// Shows details of a single workshop, including description, agenda,
// students, and actions to start the workshop or take quizzes.
export default function WorkshopDetailPage() {
  const { id } = useParams();
  const navigate = useNavigate();
  const workshop = workshops.find((w) => w.id.toString() === id);
  const { currentUser } = useContext(UserContext);

  if (!workshop) {
    return (
      <Box sx={{ p: 3 }}>
        <Typography variant="h6">Workshop not found</Typography>
      </Box>
    );
  }

  // Compute progress from localStorage: number of completed sections
  const progressInfo = useMemo(() => {
    const progressKey = `progress_${currentUser?.id}_${id}`;
    const data = JSON.parse(localStorage.getItem(progressKey) || '{}');
    let completedCount = 0;
    workshop.sections?.forEach((section) => {
      if (data[section.id]) completedCount += 1;
    });
    return {
      completedCount,
      total: workshop.sections?.length || 0,
      progressData: data,
    };
  }, [currentUser?.id, id, workshop.sections]);

  return (
    <Box>
      <Navbar />
      <Box sx={{ p: 3 }}>
        <Typography variant="h4" gutterBottom>{workshop.title}</Typography>
        <Typography variant="subtitle1" gutterBottom>Trainer: {workshop.trainerName}</Typography>
        <Typography variant="body1" gutterBottom>Description: {workshop.description}</Typography>
        <Typography variant="body1" gutterBottom>Price: {workshop.price}</Typography>
        <Typography variant="h6" sx={{ mt: 3 }}>Agenda</Typography>
        <Card sx={{ mb: 2 }}>
          <CardContent>
            {workshop.agenda.split('\n').map((line, idx) => (
              <Typography key={idx} variant="body2">{line}</Typography>
            ))}
          </CardContent>
        </Card>
        <Typography variant="h6" sx={{ mt: 3 }}>Enrolled Students</Typography>
        <List>
          {workshop.students.map((studentId) => (
            <ListItem key={studentId}>
              <ListItemText primary={`Student #${studentId}`} />
            </ListItem>
          ))}
        </List>
        <Typography variant="h6" sx={{ mt: 3 }}>Attached PPT</Typography>
        <Typography variant="body2" sx={{ mb: 2 }}>Preview not available in demo.  A PDF or PPT preview would go here.</Typography>
        {/* Sections List */}
        {workshop.sections && (
          <>
            <Typography variant="h6" sx={{ mt: 3 }}>Sections</Typography>
            <Box sx={{ mb: 2 }}>
              <LinearProgress
                variant="determinate"
                value={progressInfo.total ? (progressInfo.completedCount / progressInfo.total) * 100 : 0}
              />
              <Typography variant="caption">
                {progressInfo.completedCount} of {progressInfo.total} sections completed
              </Typography>
            </Box>
            <List>
              {workshop.sections.map((section) => {
                const done = progressInfo.progressData[section.id];
                return (
                  <ListItem key={section.id} sx={{ display: 'flex', alignItems: 'center' }}>
                    <ListItemText
                      primary={section.title}
                      secondary={done ? 'Completed' : 'Not completed'}
                    />
                    <Button
                      variant={done ? 'outlined' : 'contained'}
                      onClick={() => navigate(`/workshops/${id}/sections/${section.id}`)}
                      sx={{ ml: 2 }}
                    >
                      {done ? 'Review' : 'Start'}
                    </Button>
                  </ListItem>
                );
              })}
            </List>
          </>
        )}
        {/* Action Buttons: only enable final quiz when all sections completed */}
        <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap', mt: 2 }}>
          <Button variant="outlined" onClick={() => navigate(`/workshops/${id}/quiz`)}>
            Practice Quiz
          </Button>
          <Button
            variant="outlined"
            disabled={progressInfo.completedCount < progressInfo.total}
            onClick={() => navigate(`/workshops/${id}/final-quiz`)}
          >
            Certification Quiz
          </Button>
          <Button
            variant="contained"
            onClick={() => navigate(`/workshops/${id}/editor`)}
          >
            Open Python Editor
          </Button>
          <Button
            variant="outlined"
            onClick={() => navigate(`/workshops/${id}/certificate`)}
          >
            View Certificate
          </Button>
        </Box>
      </Box>
    </Box>
  );
}
